import Sidebar from '../Sidebar'

export default function DashboardLayout(props) {
  return (
    <div className={props.class}>
      <Sidebar/>
        <main style={{paddingLeft:"290px",backgroundColor:"#F3F3F3",height:"100%"}}>
          {props.children}
        </main>
    </div>
  )
}
